window.bookSummaryJSON = "<p><b>Concubine. Wife. Priestess.</b></p> <p>Captured by a demon king, Drake, with his memories returned, and Saraya must now come to terms with a surprising truth: Drake is not only Saraya's true mate but is also the son of a monstrous deity who bound his powers at the age of thirteen. But now the demon king wants Drake's true powers to be unbound for his own nefarious purposes.</p> <p>Forced to marry one another, Drake and Saraya must now gain the trust of the Court of the Demon King in order to escape. But there are even bigger forces at play here.</p> <p>Will Saraya give in to her desire to be Drake's fated mate? Or will she do the unthinkable?</p> <p>Join Saraya and Drake for a seductive adventure in book two of the Warrior Midwife Trilogy. Intended for mature listeners.</p>"; 
